import React from 'react';
import Navbar from './NavBar';
import Home from './Home';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
    return (
        <Router>
            <div className="container">
                <Navbar />
                <Home />
                {//<Switch>
                    //  <Route path="/" exact component={Home} />
                    //</Switch>
                }
            </div>
        </Router>
    );
}


export default App;
